import React from "react";

const Dashboard = () => {
  let classname = {
    selected: "item-selected",
    notSelected: "item-notSelected",
  };

  const navigation = [
    {
      name: "Dashboard",
      href: "#",
      current: true,
    },
    {
      name: "Add Expense Folder",
      href: "#",
      current: false,
    },
    {
      name: "Profile",
      href: "#",
      current: false,
    },
    {
      name: "Settings",
      href: "#",
      current: false,
    },
    {
      name: "Sign Out",
      href: "#",
      current: false,
    },
  ];

  const handleClick = (clickedItem, e) => {
    e.preventDefault();
    console.log(clickedItem.name);
  };

  return (
    <div className="main">
      <nav className="navigation-bar-container">
        <div className="navigation-bar">
          <div className="navigation-bar-items-container">
            <div className="navigation-bar-items">
              <div className="navigation-items">
                <div className="items">
                  {navigation.map((item) => (
                    <a
                      key={item.name}
                      href={item.href}
                      className={
                        item.current
                          ? classname.selected
                          : classname.notSelected
                      }
                      aria-current={item.current ? "page" : undefined}
                      onClick={handleClick(item)}
                    >
                      {item.name}
                    </a>
                  ))}
                  {/* <a href="#" className="nav-items">
                    Dashboard
                  </a>
                  <a href="#" className="nav-items">
                    Add Expense Folder
                  </a>
                  <a href="#" className="nav-items">
                    Profile
                  </a>
                  <a href="#" className="nav-items">
                    Settings
                  </a>
                  <a href="#" className="nav-items">
                    Sign Out
                  </a> */}
                </div>
              </div>
            </div>
          </div>
        </div>
      </nav>
      {/* <div className="taskbar">
        <div className="btns-container">
          <div className="btn-container">
            <button className="taskbar-btn">Dashboard</button>
          </div>

          <div className="btn-container">
            <button className="taskbar-btn">Add Expense Folder</button>
          </div>

          <div className="btn-container">
            <button className="taskbar-btn">Profile</button>
          </div>

          <div className="btn-container">
            <button className="taskbar-btn">Settings</button>
          </div>

          <div className="btn-container">
            <button className="taskbar-btn">Sign Out</button>
          </div>
        </div>
      </div> */}

      <div className="dashboard-title-container">
        <h1 className="dashboard-title">Dashboard</h1>
      </div>

      <div className="cards"></div>
    </div>
  );
};

export default Dashboard;
